  new Helado(4,'./default.png','Lemon Pie'           ,1    ,'./default.png'),
  new Helado(5,'./default.png','Maracuy치'            ,7   ,'./default.png'),
  new Helado(6,'./default.png','Frutilla'            ,16  ,'./default.png'),
  new Helado(7,'./default.png','Vainilla'            ,22  ,'./default.png'),
  new Helado(8,'./default.png','Lim칩n'               ,4   ,'./default.png'),
];

